import React from "react";
import CustomNavbar from "../components/CustomNavbar";
import Breadcrumb from "../components/Breadcrumb";
import BlogGrid from "../components/Blog/BlogGrid";
import FooterTwo from "../components/Footer/FooterTwo";
import FooterData from "../components/Footer/FooterData";
import SecurityFeatures from "../components/Features/SecurityFeatures";

const BlogGridPage = () => {
  return (
    <div className="body_wrapper">
      <CustomNavbar
        slogo="sticky_logo"
        mClass="menu_four"
        nClass="w_menu ml-auto mr-auto"
      />
      <Breadcrumb
        breadcrumbClass="breadcrumb_area"
        imgName="breadcrumb/banner_bg.png"
        Ptitle="Instadalali"
        Pdescription="No longer needed to scroll on hundreds of social media feeds looking for a better home. 
        Easily find your future rental house or apartment from millions of curated listings only available on the Instadalali app.
        Our goal is to have a complete list of all properties for rent and buy and reduce realtor's (dalali) fees by connecting 
        customers and landlords directly.We give you smart tools and resources to help you shop smarter for your next home"
      />
      {/* <BlogGrid /> */}
      <SecurityFeatures />
      <HomeERP />
      <FooterTwo FooterData={FooterData} />
    </div>
  );
};
export default BlogGridPage;
